import React from 'react';

class Thankyou extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
        }
    }

    render() {
        return (
            <div className="cat">
                <label className="db fw6 lh-copy f1" htmlFor="name">Thank you very much for sharing!!</label>
            </div>
        );
    }
}


export default Thankyou;
